import React from "react";
import Link from "next/link";

const Nav = ({ categories }) => {
  return (
    <div>
      {categories.map((category) => {
        return (
          <Link
            key={category.id}
            as={`/category/${category.id}`}
            href="/category/[id]"
          >
            <button>{category.name}</button>
          </Link>
        );
      })}
    </div>
  );
};

export default Nav;
